import './App.css';
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import ArticleListPage from './pages/ArticleListPage';
import ArticlePage from './pages/ArticlePage';

function App() {
  return (
    <div className="App">
      <h1>Torah Tales</h1>
      <div id='page-body'>
        <HomePage />
        <AboutPage />
        <ArticleListPage />
        <ArticlePage />

      </div>
    </div>
  );
}

export default App;
